#oriaku solution
letters = {}
for key, value in enumerate(text):
	if value not in letters:
		letters[value] = 1
	else:
		letters[value] += 1
		
	if letters[value] == 252:
		startletter = value
	if letters[value] == 249:
		endletter = value

#find the secret word
result = ''
for key, character in enumerate(text):
	if text[key - 1] == startletter and text[key + 1] == endletter:
		result += character
print(result)






